import React from "react";
import "./App.css";
import {
  NavScroll,
  Navbar1,
  Slider,
  Products,
} from "./Pages/Homepage/homepage";
import "bootstrap/dist/css/bootstrap.min.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="App">
      {/* <NavScroll />
      <Navbar1 />
      <Slider />
      <Products /> */}
      <BrowserRouter>
        <Routes>
          <Route
            exact
            path="/"
            element={
              <React.Fragment>
                <NavScroll />
                <Navbar1 />
                <Slider />
                <Products />
              </React.Fragment>
            }
          />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
